#include <iostream>#include <vector>#include <algorithm>using namespace std;int main() {	int n;	cin >> n;	vector<int> vec;	int tmp;	for (int i = 0; i < n; i++) {		cin >> tmp;		vec.push_back(tmp);	}	sort(vec.begin(), vec.end());	for (int i = 0; i < n; i++) {		cout << vec[i]<<" ";	}}